import LoginForm from '../../components/pure/forms/LoginForm';

const LoginPage = () => {
    return (
        <div>
            <h1>Login</h1>
            <h2>And start putting your stuff in order!</h2>

            <LoginForm></LoginForm>
        </div>
    );
}

export default LoginPage;
